import React from 'react';

import StockInfo from './StockInfo';
import './home_page.css';

export default class home_page extends React.Component{
    constructor(props){
        super(props);
        this.state={search: "FB", isSubmitted: false, isSubmitted1: true};
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleSubmit(event){
        console.log("submitting!", this.state.search);
        event.preventDefault();
        this.setState({isSubmitted: !this.state.isSubmitted, isSubmitted1: !this.state.isSubmitted1});
    }
    handleChange(event){
        this.setState({search: event.target.value});
    }

    render(){
        console.log(this.state.search)
        return(
        <div className="home_page">
            <h1>This is the home page!</h1>
            <form onSubmit={this.handleSubmit}>
                <label>
                    Search for Stocks
                    <textarea value={this.state.search} onChange={this.handleChange}/>
                </label>
                <input type="submit" value="Submit"/>
            </form>


            <div className="stock_graph">
                {(this.state.isSubmitted||this.state.isSubmitted1) && <StockInfo symbol={this.state.search}/>}
            </div>
        </div>);
    }
}
